description.text:
This is a re-design of a fixed wing RC motor mount, originally created by the guys over at Flitetest.com for their swappable foamy builds.  The original was made from thin, laser-cut plywood which I broke during a catastrophic deceleration event.  
The original didn't fit well with my electric motor - the provided screws were smaller than the motor's mounting bracket holes - so this engine mount was designed to allow the use of zip-ties instead of screws.  
Its 1g heavier than the original when printed fully dense in PLA and I'm hopeful it will dissipate energy by either bending, breaking or having the zip-ties break during another such &quot;event&quot;
